The easiest and most visible improvement you can make to your typography is to use a professional font *Butterickâ€™s Practical Typography, Summary of key rules * The font-family CSS property sets the font face. This example sets the font to Garamond , a nice-looking web safe font. body { font-family: Garamond;
} There are lots of fonts. For using fonts on a web page, there are two categories you need to know: web safe fonts and custom fonts. Web Safe Fonts These fonts are pre-installed on most computers, so you can use them without any other steps. See CSS Font Stack for the list. Custom Fonts If you want to use fonts that arenâ€™t already installed on the userâ€™s computer, you can use a <link> tag to load the font, just like you link a stylesheet. That way, the browser knows where to download the font before using it. Google Fonts is a tool for finding and using custom fonts. You can browse or search for a font, then copy a <link> tag and font-family rule to use in your site. See the example for use under the toggle Example: Google Fonts usage For using the font Merriweather in Regular, Italic , and Bold, loading from Google fonts. Add this to the <head> in index.html <link rel="preconnect" href="https://fonts.googleapis.com">
<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
<link href="https://fonts.googleapis.com/css2?family=Merriweather:ital,wght@0,400;0,700;1,400&display=swap" rel="stylesheet"> And use this as the CSS rule for the text to style (in this case, body): body { font-family: 'Merriweather', serif;
} Both of these are copied from the Google Fonts page after selecting the fonts. Font stacks and Fallbacks Since different users have different fonts installed, the font-family property allows specifying a list of fonts. The browser will try each one in order, and use the first one that works. For example: font-family: "Lucida Grande", "Lucida Sans", Geneva, Verdana, sans-serif; Will try Lucida Grande first, then Lucida Sans, then Geneva, then Verdana, then the browserâ€™s default sans-serif font. The first one that the computer has installed will be used. Further Exploration: Web Fonts Read the MDN page on Web Fonts to learn more about font stacks and setting custom fonts. Using font-face CSS property to declare your own fonts Details about how font loading works

