People visually recognize links because they are styled differently from other text. Often, they are colored differently and underlined. Links are a good time to use an accent color to style text. You can change the text-decoration - you can remove the underline, or show it only on hover. You can style other properties, like background-color and border-bottom. Link states: hover, visited, active Links can show differently when they are hovered over, or after theyâ€™ve been clicked. To apply styles to particular states, you need a new kind of selector: the :hover and :visited pseudo-selectors. /* default link styles */
a { text-decoration: none; color: royalblue;
} /* link styles when hovered */
a:hover { text-decoration: underline; color: midnightblue;
} /* link styles after visited */
a:visited { text-decoration: none; color: darkorchid;
} Itâ€™s also nice to be able to make the cursor show differently when hovering something clickable. By default, clickable links have cursor: pointer to make the pointer into a little hand icon. You can apply this yourself to other elements that are meant to be clicked. Read more about styling links on MDN .

